import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
var t = new Date();
var time = t.getHours();
const sen = "Good Night";

const CssStyle = {
  color : 'green'
};
if(time<=12){ sen = "Good Morning";  CssStyle.color ="green"; }
else if(time<=4){ sen ="Good After-Noon"; CssStyle.color ="pink"; }
else if(time<=7){ sen = "Good Evening"; CssStyle.color = "yellow"; }
else{ sen = "Good Night"; CssStyle.color= "red"; }

ReactDOM.render(
  <>
     <h1 className= "CssStyle">HII EVERYONE { sen }</h1>
     <p> current time is { time }</p>
  </>,
  document.getElementById('root')
);
